import { Box, Grid } from "@mui/material";
import "./App.css";
import logo from "./Logo.svg";
import LayoutAppBar from "./app/components/AppBar";

function App() {
  return (
    <>
      <LayoutAppBar />
      <Box
        sx={{
          backgroundImage: `url(${logo})`,
          height: "500px",
          backgroundRepeat: "no-repeat",
          backgroundSize: "cover",
          backgroundPosition: "center",
        }}
      >
        <Grid>
          <Grid></Grid>
        </Grid>
      </Box>
    </>
  );
}

export default App;
